m: 0; // Override the `<label>` default\r\n\r\n  line-height: $input-line-height;\r\n  word-break: normal;\r\n}\r\n\r\n.col-form-label-lg {\r\n  padding-top: $input-padding-y-lg;\r\n  padding-bottom: $input-padding-y-lg;\r\n  font-size: $font-size-lg;\r\n\r\n  line-height: $input-line-height;\r\n  word-break: normal;\r\n}\r\n\r\n.col-form-label-sm {\r\n  padding-top: $input-padding-y-sm;\r\n  padding-bottom: $input-padding-y-sm;\r\n  font-size: $font-size-sm;\r\n\r\n  line-height: $input-line-height;\r\n  word-break: normal;\r\n}\r\n','// $input-border-focus   $input-box-shadow-focus\r\n\r\n$checkbox-width: 1.1em !default;\r\n$checkbox-height: $checkbox-width !default;\r\n\r\n$checkbox-border-radius: 2px !default;\r\n$checkbox-border-width: 2px !default;\r\n//\r\n// ^^ defined in variables.scss\r\n//\r\n$checkbox-margin: 16px !default;\r\n$checkbox-text-margin: 10px !default;\r\n$checkbox-top: 12px !default;\r\n\r\n\r\n$square-checked-flag:0.75em;\r\n$border-width-thick:3px;\r\n\r\n\r\n.checkbox-wappper {\r\n\r\n\r\n\r\n  [type="checkbox"]{\r\n      width: 1px;\r\n      height: 1px;\r\n      border: 0;\r\n      clip: rect(0 0 0 0);\r\n      margin: -1px;\r\n      overflow: hidden;\r\n      padding: 0;\r\n      position: absolute;\r\n\r\n  }\r\n\r\n  .checkbox-label{\r\n    margin-right: 1.5rem;\r\n  }\r\n\r\n  .checkbox{\r\n    background: #ffffff;\r\n    width: $checkbox-width;\r\n    height: $checkbox-height;\r\n    display: inline-block;\r\n    position: relative;\r\n    vertical-align: middle;\r\n    border: 1px solid #d8dde6;\r\n    border-radius: $checkbox-border-radius;\r\n    //background: #fff;\r\n    transition: border .1s linear,background-color .1s linear;\r\n    line-height:30px;\r\n    margin-right: .5rem;\r\n    cursor: pointer;\r\n    outline: none;\r\n\r\n    &:last-of-type {\r\n      margin-left: 0;\r\n      margin-right: 0;\r\n    }\r\n\r\n\r\n    &.checked{\r\n      border-color:$input-border-focus;\r\n      @include box-shadow($input-box-shadow-focus);\r\n      &:after {\r\n        display: block;\r\n        content: \'\';\r\n        height: ($square-checked-flag / 2);\r\n        width: $square-checked-flag;\r\n        position: absolute;\r\n        top: 50%;\r\n        left: 50%;\r\n        transform: translate3d(-50%, -50%, 0) rotate(-45deg);\r\n        border-bottom: $border-width-thick solid #4B68B2;\r\n        border-left:  $border-width-thick solid #4B68B2;\r\n      }\r\n    }\r\n    &:not(.checked){\r\n      //&:after{\r\n      //  border-bottom: $border-width-thick solid #4B68B2;\r\n      //  border-left:  $border-width-thick solid #4B68B2;\r\n      //}\r\n    }\r\n\r\n    &:not(.disabled){\r\n\r\n    }\r\n\r\n\r\n\r\n  }\r\n\r\n}\r\n\r\n\r\n\r\n\r\n\r\n\r\n//.md-inline-form {\r\n//  input[type="checkbox"] {\r\n//    margin: 19px 0 18px;\r\n//  }\r\n//}\r\n//\r\n//input[type="checkbox"] {\r\n//  box-sizing: border-box;\r\n//  display: inline-block;\r\n//  margin-bottom: $checkbox-margin;\r\n//  white-space: nowrap;\r\n//  cursor: pointer;\r\n//  outline: none;\r\n//  user-select: none;\r\n//  position: relative;\r\n//  min-width: $checkbox-width;\r\n//  min-height: $checkbox-width;\r\n//  @include rtl(margin-left, 0, $checkbox-margin);\r\n//  @include rtl(margin-right, $checkbox-margin, 0);\r\n//\r\n//  &:last-of-type {\r\n//    margin-left: 0;\r\n//    margin-right: 0;\r\n//  }\r\n//\r\n//  &.md-focused:not([disabled]) {\r\n//    .md-container:before {\r\n//      left: -8px;\r\n//      top: -8px;\r\n//      right: -8px;\r\n//      bottom: -8px;\r\n//    }\r\n//\r\n//    &:not(.md-checked) {\r\n//      .md-container:before {\r\n//        background-color: rgba(0, 0, 0, 0.12);\r\n//      }\r\n//    }\r\n//  }\r\n//\r\n//  &.md-align-top-left > div.md-container {\r\n//    top: $checkbox-top;\r\n//  }\r\n//\r\n//  @include checkbox-container;\r\n//\r\n//  .md-label {\r\n//    box-sizing: border-box;\r\n//    position: relative;\r\n//    display: inline-block;\r\n//    vertical-align: middle;\r\n//    white-space: normal;\r\n//    user-select: text;\r\n//\r\n//    @include rtl(margin-left, $checkbox-text-margin + $checkbox-width, 0);\r\n//    @include rtl(margin-right, 0, $checkbox-text-margin + $checkbox-width);\r\n//\r\n//  }\r\n//}\r\n','$enable-shadows: true !default;\r\n$enable-transitions: true !default;\r\n\r\n// Pixel value used to responsively scale all typography. Applied to the `<html>` element.\r\n$font-size-root: 16px !default;\r\n$font-size-base: 1rem !default;\r\n$font-size-lg:   1.25rem !default;\r\n$font-size-sm:   .875rem !default;\r\n$font-size-xs:   .75rem !default;\r\n\r\n$border-width:   1px !default;\r\n$border-radius:          .25rem !default;\r\n$border-radius-lg:       .3rem !default;\r\n$border-radius-sm:       .2rem !default;\r\n\r\n// 3. Spacing\r\n//\r\n// Control the default styling of most Bootstrap elements by modifying these\r\n// variables. Mostly focused on spacing.\r\n// You can add more entries to the $spacers map, should you need more variation.\r\n\r\n$spacer:   1rem !default;\r\n$spacer-x: $spacer !default;\r\n$spacer-y: $spacer !default;\r\n$spacers: (\r\n        0: (\r\n                x: 0,\r\n                y: 0\r\n        ),\r\n        1: (\r\n                x: ($spacer-x * .25),\r\n                y: ($spacer-y * .25)\r\n        ),\r\n        2: (\r\n                x: ($spacer-x * .5),\r\n                y: ($spacer-y * .5)\r\n        ),\r\n        3: (\r\n                x: $spacer-x,\r\n                y: $spacer-y\r\n        ),\r\n        4: (\r\n                x: ($spacer-x * 1.5),\r\n                y: ($spacer-y * 1.5)\r\n        ),\r\n        5: (\r\n                x: ($spacer-x * 3),\r\n                y: ($spacer-y * 3)\r\n        )\r\n) !default;\r\n\r\n$line-height-lg:         (4 / 3) !default;\r\n$line-height-sm:         1.5 !default;\r\n//Form\r\n// 13. Forms\r\n$input-padding-x:                .75rem !default;\r\n$input-padding-y:                .5rem !default;\r\n$input-line-height:              1.5 !default;\r\n$input-btn-border-width:         $border-width !default; // For form controls and buttons\r\n$primary-bgcolor: #3965CE;\r\n\r\n\r\n$input-box-shadow:               inset 0 1px 1px rgba(0,0,0,.075) !default;\r\n\r\n$input-box-shadow-hui:           0 0 0 2px #CDD8F3 !default;\r\n\r\n$input-border-radius:            $border-radius !default;\r\n$input-border-radius-lg:         $border-radius-lg !default;\r\n$input-border-radius-sm:         $border-radius-sm !default;\r\n\r\n$input-padding-x-sm:             .5rem !default;\r\n$input-padding-y-sm:             .25rem !default;\r\n\r\n$input-padding-x-lg:             1.5rem !default;\r\n$input-padding-y-lg:             .75rem !default;\r\n\r\n$input-height:  (($font-size-base * $input-line-height) + ($input-padding-y * 2)) !default;\r\n$input-height-lg:(($font-size-lg * $line-height-lg) + ($input-padding-y-lg * 2)) !default;\r\n$input-height-sm: (($font-size-sm * $line-height-sm) + ($input-padding-y-sm * 2)) !default;\r\n\r\n\r\n\r\n$input-bg:                       #fff !default;\r\n$input-bg:                       #fff !default;\r\n$input-bg-disabled:              $primary-bgcolor !default;\r\n$input-color:                    $primary-bgcolor  !default;\r\n$input-color-focus:              $input-color !default;\r\n$input-color-placeholder:        #999 !default;\r\n$form-group-margin-bottom:       $spacer-y !default;\r\n$input-group-addon-bg:           $primary-bgcolor !default;\r\n\r\n$input-border-color:             #C7C7C7 !default;\r\n\r\n$input-group-addon-border-color: $input-border-color !default;\r\n\r\n\r\n$input-bg-focus:                 $input-bg !default;\r\n$input-border-focus:             $primary-bgcolor!default;\r\n$input-box-shadow-focus:         $input-box-shadow-hui!default  ;     // $input-box-shadow, 0 0 8px rgba($input-border-focus,.6) !default;\r\n$input-box-shadow-hover:         0 0 0 2px #E2E2E2 !default;\r\n\r\n\r\n@mixin box-shadow($shadow...) {\r\n  @if $enable-shadows {\r\n    box-shadow: $shadow;\r\n  }\r\n}\r\n\r\n@mixin transition($transition...) {\r\n  @if $enable-transitions {\r\n    transition: $transition;\r\n  }\r\n}\r\n\r\n\r\n\r\n@mixin form-control-focus() {\r\n  &:focus {\r\n    color: $input-color-focus;\r\n    background-color: $input-bg-focus;\r\n    border-color: $input-border-focus;\r\n    outline: none;\r\n    @include box-shadow($input-box-shadow-focus);\r\n  }\r\n}\r\n\r\n@mixin form-control-hover(){\r\n  &:hover {\r\n    @include box-shadow($input-box-shadow-hover);\r\n  }\r\n}\r\n\r\n\r\n@import "label";\r\n@import "./checkbox/checkbox";\r\n@import "./combo/combo";\r\n@import \'fakeInput\';\r\n\r\n\r\n\r\n\r\n.form-control {\r\n  display: block;\r\n  width: 100%;\r\n  padding: $input-padding-y $input-padding-x;\r\n  font-size: $font-size-base;\r\n  line-height: $input-line-height!important;\r\n  color: $input-color;\r\n  background-color: $input-bg;\r\n  // Reset unusual Firefox-on-Android default style; see https://github.com/necolas/normalize.css/issues/214.\r\n  background-image: none;\r\n  background-clip: padding-box;\r\n  border: $input-btn-border-width solid $input-border-color;\r\n  border-radius: 2px;\r\n  @include form-control-hover();\r\n  @include form-control-focus();\r\n  @include transition(border-color ease-in-out .15s, box-shadow ease-in-out .15s);\r\n  &[disabled],&.disable{\r\n    cursor: default;\r\n   -webkit-user-select: none;\r\n   -moz-user-select: none;\r\n   -ms-user-select: none;\r\n   border-color: #DCDCDC;\r\n   background-color: #FFFFFF;\r\n   color: #B8B8B8;\r\n   box-shadow:none;\r\n  }\r\n}\r\n\r\n.form-control-lg{\r\n  font-size: $font-size-lg;\r\n  line-height: $line-height-lg!important;\r\n  height:$input-height-lg!important ;\r\n}\r\n\r\n.form-control-sm {\r\n  font-size: $font-size-sm;\r\n  line-height: $line-height-sm!important;\r\n  height:$input-height-sm!important;\r\n}\r\n\r\n','$comboinput-height: 2.4em;\r\n$comboinput-lineheight:1.5 !default;\r\n.primary-text {\r\n    line-height: 18px;\r\n    display: block;\r\n    color: #404040;\r\n    font-family: "DinNext", Arial, sans-serif;\r\n    font-size: 18px;\r\n    letter-spacing: -0.05em;\r\n    margin: 0px;\r\n}\r\n\r\n.combo-no-padding {\r\n  padding-right:0 !important;\r\n  padding-left:0 !important;\r\n}\r\n\r\n.combo-input-lg,.combo-action-lg{\r\n  font-size: $font-size-lg!important;\r\n  line-height: $line-height-lg!important;\r\n  height:$input-height-lg!important ;\r\n  i{\r\n    font-size: $font-size-lg;\r\n  }\r\n}\r\n\r\n.combo-input-sm,.combo-action-sm {\r\n  font-size: $font-size-sm!important;\r\n  line-height: $line-height-sm!important;\r\n  height:$input-height-sm!important;\r\n  i{\r\n    font-size: $font-size-sm;\r\n  }\r\n}\r\n\r\n//\r\n\r\n\r\n\r\n.combo {\r\n  display: block;//bfc\r\n  &.icon-combo{\r\n    button.combo-action{\r\n      background: transparent;\r\n      &:active{\r\n        border-left-width:1px!important;\r\n        border-right-width:1px!important;\r\n      }\r\n      i{\r\n        font-size: $font-size-base*2;\r\n      }\r\n    }\r\n  }\r\n\r\n\r\n  &.action-pos-right{\r\n    .combo-action{\r\n      border-left-width: 0;\r\n      border-radius: 0 2px 2px 0;\r\n    }\r\n      .combo-input,.form-control {\r\n       // border-right-width: 0 !important;\r\n        border-radius: 2px 0 0 2px;\r\n      }\r\n    }\r\n\r\n    &.action-pos-left{\r\n      .combo-action{\r\n        border-right-width: 0 ;\r\n        border-radius: 2px 0 0 2px;\r\n      }\r\n      .combo-input,.form-control {\r\n        //border-left-width: 0!important;\r\n        border-radius: 0 2px 2px 0;\r\n      }\r\n  }\r\n\r\n}\r\n\r\n\r\n.combo-action {\r\n  border-radius: 2px 0 0 2px;\r\n\r\n  line-height:$input-line-height;\r\n  height: $input-height;\r\n  font-size: $font-size-base;\r\n\r\n  vertical-align: top;//如果是按钮 要靠上\r\n  //min-width:100px;\r\n  width:100%;\r\n\r\n  i{\r\n    font-size: $font-size-base*2;\r\n    color:#365EBF;\r\n  }\r\n}\r\n\r\n.combo-input {\r\n  width:100% ;\r\n  line-height:$input-line-height;\r\n  height: $input-height;\r\n  font-size: $font-size-base;\r\n  padding-left:0.5em;\r\n  border: 1px solid #DCDCDC;\r\n  outline:none;\r\n  @include form-control-hover();\r\n  @include form-control-focus();\r\n\r\n  &.primary-text {\r\n      font-family: "DinNext", Arial, sans-serif;\r\n  }\r\n}\r\n\r\n\r\n.combo-fake {\r\n  background: -webkit-gradient(linear, left top, left bottom, color-stop(0%, #FFFFFF), color-stop(100%, #F2F2F2));\r\n  background: -webkit-linear-gradient(top, #FFFFFF 0%, #F2F2F2 100%);\r\n  background: -ms-linear-gradient(top, #FFFFFF 0%, #F2F2F2 100%);\r\n  background: linear-gradient(to bottom, #FFFFFF 0%, #F2F2F2 100%);\r\n}\r\n\r\n',"//像 dropdown  timepicker这样不用input 但是要像input一样\r\n\r\n$switcher-width: 16px;\r\n$switcher-margin: 8px;\r\n$switch-flag:8px;\r\n\r\n.dropdown,.datepicker-input{\r\n  &.fake-input{\r\n    background: -webkit-gradient(linear, left top, left bottom, color-stop(0%, #FFFFFF), color-stop(100%, #F2F2F2));\r\n    background: -webkit-linear-gradient(top, #FFFFFF 0%, #F2F2F2 100%);\r\n    background: -ms-linear-gradient(top, #FFFFFF 0%, #F2F2F2 100%);\r\n    background: linear-gradient(to bottom, #FFFFFF 0%, #F2F2F2 100%);\r\n  }\r\n}\r\n.fake-input {\r\n  display: inline-block;\r\n  width: 100%;\r\n  min-height: 2.6em;\r\n  border-color: transparent;\r\n  //border-bottom: 2px solid #f0f0f0;\r\n  overflow: hidden;\r\n  border-radius: 2px;\r\n  border: 1px solid #C7C7C7;\r\n  outline: none;\r\n  padding: $input-padding-y $input-padding-x;\r\n  font-size: $font-size-base;\r\n  line-height: $input-line-height;\r\n  background: #FFFFFF;\r\n  &:hover{\r\n    background: #FFFFFF;\r\n  }\r\n\r\n  .text {\r\n    display: inline-block;\r\n    outline: 0;\r\n    // min-width:200px\r\n    width: 100%;\r\n  }\r\n\r\n  .icon-right{\r\n    float:right;\r\n    position:relative;\r\n    width: $switch-flag *2;\r\n    height: $switch-flag *2;\r\n  }\r\n}\r\n\r\n\r\n.fake-input-lg{\r\n  font-size: $fon